    /**
     * Get the IDNA2003 deviation from IDNA2008 for a specific code point.
     *
     * @param int $codepoint
     *
     * @return int[]|null
     */
    public static function getDeviation($codepoint)
    {
        return isset(static::$deviations[$codepoint]) ? static::$deviations[$codepoint] : null;
    }

