    /**
     *Check if a codepoint is ignored.
     *
     *@param int $codepoint
     *
     *@return bool
     */
    public static function isIgnored($codepoint)
    {
        $result = false;
        if (
            in_array($codepoint, static::$ignoredSingle, true)
            || ($codepoint >= 917760 && $codepoint <= 917999)
        ) {
            $result = true;
        }

        return $result;
    }

